import React from "react";

import "./custom-buttom.styles.scss";

const CustomButton = ({
  children,
  isGoogleSignIn,
  inverted,
  more,
  ...otherProps
}) => (
  <button
    className={`${inverted ? "inverted" : ""} ${
      isGoogleSignIn ? "google-sign-in" : ""
    } custom-button ${more ? "more" : ""}`}
    {...otherProps}
  >
    {children}
  </button>
);

export default CustomButton;
